from pickle import TRUE


def isValid(s):
    char_count = {}
    for x in s:
        if x in char_count.keys():
            char_count[x] = char_count[x]+1
        else:
            char_count[x] = 1
    print(char_count)
    occurence_frequency = {}
    for x in char_count.values():
        if x in occurence_frequency.keys():
            occurence_frequency[x] = occurence_frequency[x]+1
        else:
            occurence_frequency[x] = 1        
    print(occurence_frequency)
    if len(occurence_frequency.keys())==1:
        return "YES"
    if len(occurence_frequency.keys())>2:
        return "NO"
    if 1 in occurence_frequency.keys() and occurence_frequency.get(1)>1:
        return "NO"

    found = "NO"
    xxx = list(occurence_frequency.keys())
    if xxx[0] ==1:
        return "YES"
    if xxx[1] ==1:
        return "YES"    
    if abs(xxx[0]-xxx[1]) > 1 and (xxx[0]!=1 or xxx[1]!=1):
        return 'NO'
    for x in xxx:
        if occurence_frequency[x]==1:
            found = "YES"
            break
    return found


if __name__ == "__main__":
    x = ""
    y = "aaaabbcc"
    print(isValid(x))
